INSERT INTO `competition_types` (`id`, `name`, `code`, `description`, `status`, `created_at`, `updated_at`, `image`, `slug`, `class`, `tm_video`, `tm_file`, `date_start`, `date_end`) VALUES (1,'Adzan','ADZAN','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SD/MI Putra A ( kelas, 1,2&nbsp;dan 3)</li>\r\n	<li>SD/ MI Putra B ( kelas 4,5&nbsp;dan 6)</li>\r\n	<li>SMP/MTS Putra</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SD/MI Putra A : 30 Peserta</li>\r\n	<li>SD/MI Putra B : 30 Peserta</li>\r\n	<li>SMP/MTS Putra : 30 Peserta</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>c. Point dan Presentase Penilaian</strong></span></h5>\r\n\r\n<ul>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Makhraj dan tajwid&nbsp;</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 35</span></span></span></span></span></li>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Irama dan Suara</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\"> : 25</span></span></span></span></span></li>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Penjiwaan dan Penghayatan </span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 25</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Adab dan Ketepatan Durasi&nbsp;</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 15</span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Teknis dan Peraturan Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Peserta harus menyelesaikan registrasi COMIC X secara lengkap.</li>\r\n	<li>Peserta diwajibkan mengikuti TM (<em>Technical Meeting</em>) sesuai dengan jadwal yang diinformasikan. Semua pertanyaan di setiap lomba akan dijawab langsung oleh Penanggung Jawab lomba di TM (<em>Technical Meeting</em>).</li>\r\n	<li>Peserta diharapkan paham dan mengikuti semua peraturan yang ada di lomba Adzan.</li>\r\n	<li>Diharuskan menggunakan <strong>ADZAN SUBUH.</strong></li>\r\n	<li>Durasi perlombaan yakni 6 menit.</li>\r\n	<li>Menggunakan pakaian yang rapi.</li>\r\n	<li>Di larang menggunakan background yang tidak senonoh/ tidak sopan (Contoh : ada botol bir di background dll)</li>\r\n	<li>Peserta diharapkan mengambil video dalam One Take Shot (sekali pengambilan video).</li>\r\n	<li>Peserta dilarang mengedit video (seperti di cut, dsb).</li>\r\n	<li>Peserta diharuskan mengunggah video ke&nbsp;<em>Google Drive&nbsp;</em>masing-masing, kemudian mengunggah <em>link Google Drive&nbsp;</em>tersebut ke&nbsp;<em>Website&nbsp;</em>COMIC X. Untuk penjelasan lebih lanjut, silahkan lihat video di via&nbsp;<em>YouTube, Instagram, dan Website&nbsp;</em>COMIC X.</li>\r\n	<li>Video diawali dengan perkenalan&nbsp; peserta (Salam, Nama, No. Urut, Kategori Peserta, Asal Sekolah).</li>\r\n	<li>Peserta diharapkan mengumpulkan video tepat pada waktunya.</li>\r\n	<li>Peserta dilarang&nbsp;<em>Lipsync&nbsp;</em>saat membuat video.</li>\r\n	<li>Kualitas&nbsp;video yang dikirim harus jelas, disarankan video berkualitas 720p/HD atau 1080p/<em>full&nbsp;</em>HD.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat pengeras suara, seperti Microphone, dsb.</li>\r\n</ul>',1,'2020-10-21 07:34:07','2021-12-16 09:43:27','adzan.jpg','adzan','SD, SMP','<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YGJHaRgmooU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','https://drive.google.com/file/d/1pdP_mApYvsqwZU2G6QQGrFDVCTT1yM2x/view?usp=sharing','2021-02-07 00:00:00','2021-02-12 00:00:00'),(2,'Da\'i','DAI','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3)</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6)</li>\r\n	<li>SMP/MTs</li>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3) : 25 Peserta</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6) : 25 Peserta</li>\r\n	<li>SMP/MTs : 25 Peserta</li>\r\n	<li>SMA/SMK/MA : 25 Peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3) : Berbakti kepada Orang Tua.</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6) : Sholat adalah tolok ukur amal.</li>\r\n	<li>SMP/MTs : Peran pemuda islam untuk memperkuat iman dalam perkembangan teknologi.</li>\r\n	<li>SMA/SMK/MA : Pandangan pemuda islam tentang zina.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Lomba</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi secara lengkap.</li>\r\n	<li>Para peserta diharapkan mengikuti semua aturan yang telah berlaku di COMIC X.</li>\r\n	<li>Peserta dilarang menggunakan konten yang bersifat rasis, sara, dan pornografi.</li>\r\n	<li>Peserta tampil dengan Bahasa Indonesia yang baik dan benar.</li>\r\n	<li>Peserta harus menyampaikan materi sesuai dengan tema yang telah ditentukan.</li>\r\n	<li>Durasi berdakwah maksimal 6 menit.</li>\r\n	<li>Perkenalan peserta meliputi (Salam, Nama, Kategori, Nomor Urut, dan Muqodimah). Selanjutnya dakwah bisa dimulai.</li>\r\n	<li>Peserta diharuskan mengupload video ke Google Drive masing-masing kemudian mengupload Link Google Drive tersebut ke Website COMIC X. Untuk penjelasan lebih jelas, bisa melihat video di Youtube, Instagram dan Website COMIC X.</li>\r\n	<li>Video dibuat se-transparan mungkin agar menghindari kecurangan dan meyakinkan dewan juri, mengingat lomba dilaksanakan secara virtual.</li>\r\n	<li>Audio harus terdengar dengan jelas.</li>\r\n	<li>Kualitas video yang dikirim disarankan yang berkualitas 720p/HD atau 1080/FULL HD.</li>\r\n	<li>Keputusan juri mutlak, tidak bisa diganggu gugat.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">e. Durasi Lomba</span></strong></h5>\r\n\r\n<ul>\r\n	<li>6 menit / peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">f. Point dan Presentasi Penilaian</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Isi : 20 point</li>\r\n	<li>Mimik &amp; Intonasi : 25 point</li>\r\n	<li>Penguasaan Materi : 30 point</li>\r\n	<li>Tata Krama &amp; Ketaatan Peraturan : 10 point</li>\r\n	<li>Aksentuasi : 15 point</li>\r\n</ol>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">g. Peraturan</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Peserta tampil dengan menggunakan Bahasa Indonesia yang baik dan<br />\r\n	benar.</li>\r\n	<li>Peserta dilarang menggunakan konten yang bersifat rasis dan sara.</li>\r\n	<li>Peserta menggunakan pakaian yang rapi dan sopan.</li>\r\n	<li>Durasi berdakwah maksimal 6 menit.</li>\r\n	<li>Batas waktu tidak boleh lebih dari 6 menit.</li>\r\n	<li>Waktu 6 menit yang diawali dengan perkenalan peserta (Salam, Nama, Kategori, Nomer Urut, dan Muqodimah). Selanjutnya dakwah bisa dimulai.</li>\r\n	<li>Untuk teks dakwah, peserta diperbolehkan untuk membuat teks orisinil sesuai tema dan kemampuan peserta sendiri. Peserta diperbolehkan untuk mencari referensi di Google, namun dilarang menjiplak karya orang lain.</li>\r\n	<li>Peserta dilarang membawa teks atau membaca teks selama berdakwah. Jika terlihat gerak-gerik peserta seperti membaca teks, maka akan dilakukan pengurangan poin.</li>\r\n	<li>Peserta diharuskan mengambil video dalam One Take Shot (sekali pengambilan video).</li>\r\n	<li>Peserta dilarang mengedit video (seperti cut video, green screen, dsb).</li>\r\n	<li>Peserta dibebaskan untuk berekspresi, baik satu sisi maupun dua sisi.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat penjelas suara, seperti Microphone, dsb.\r\n	<ol>\r\n		<li>Namun memakai microphone tidak diwajibkan dan tidak menjadi patokan penilaian, jadi jika peserta yang memiliki microphone, dipersilahkan.</li>\r\n		<li>Poin pentingnya ialah audio (suara) harus jelas, jika peserta tidak menggunakan microphone, dimohon untuk kualitas audio supaya jelas terdengar.</li>\r\n	</ol>\r\n	</li>\r\n	<li>Pengambilan video peserta diwajibkan landscape.</li>\r\n	<li>Peserta dilarang lipsync</li>\r\n</ol>',1,'2020-10-21 07:34:07','2021-12-16 08:16:53','dai.jpg','dai','SD, SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-12 00:00:00'),(3,'Pop Religi','POP','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Kategori SD/MI (A) (Mencakup Putra dan Putri)</li>\r\n	<li>Kategori SD/MI (B) (Mencakup&nbsp;Putra dan Putri)</li>\r\n	<li>Kategori SMP/MTs&nbsp;(Mencakup Putra dan Putri)</li>\r\n	<li>Kategori SMA/SMK/MA (Mencakup Putra dan Putri)</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Kategori SD/MI (A) (Kelas 1, 2, dan 3) : 25 Peserta&nbsp;</li>\r\n	<li>Kategori SD/MI (B) (Kelas 4, 5, dan 6) : 25 Peserta&nbsp;</li>\r\n	<li>Kategori SMP/MTs&nbsp;: 25 Peserta&nbsp;</li>\r\n	<li>Kategori SMA/SMK/MA : 25 Peserta&nbsp;</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Ekspresikan Bakatmu Melalui Hobimu</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Pelaksanaan Lomba Pop Religi</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Peserta sudah melakukan registrasi secara lengkap</li>\r\n	<li>Peserta diharapkan mengikuti semua aturan yang berlaku di COMIC X</li>\r\n	<li>Peserta Perlomabaan POP RELIGI melakukan perlombaan secara virtual berupa video</li>\r\n	<li>Kualitas Video harus jelas, disarankan 720p/HD atau 1080HD/full HD dan Audio harus terdengar jelas</li>\r\n	<li>Peserta diwajibkan melakukan video tampak seluruh bagian anggota badan dari atas kepala sampai alas kaki.</li>\r\n	<li>Peserta Menggunakan Bahasa Indonesia yang baik dan sopan.</li>\r\n	<li>Peserta menggunakan pakaian bebas rapi dan sesuai dengan ketentuan perlombaan.</li>\r\n	<li>Peserta Dilarang Menggunakan Konten yang bersifat rasis dan sara.</li>\r\n	<li>Peserta dilarang lipsync atau membawa teks selama perlombaan.</li>\r\n	<li>Jika terlihat gerak gerik peserta seperti membaca teks, maka akan dilakukan pengurangan point.</li>\r\n	<li>Panitia menyediakan 50 list lagu untuk kemudian dipilih oleh peserta untuk dinyanyikan pada saat perlombaan.</li>\r\n	<li>Satu judul lagu maximal dipilih oleh 3 orang peserta, jika ada peserta lain memilih judul lagu yang sama, maka peserta diharapkan bersedia untuk mengganti pilihannya.</li>\r\n	<li>Durasi Video, 6 menit per peserta.</li>\r\n	<li>Peserta diharuskan mengunggah video ke Google Drive masingmasing. Kemudian mengunggah link Google Drive tersebut ke Website COMIC X. Untuk lebih jelas bisa melihat video penjelasannya di YouTube,Instagram dan Website COMIC X</li>\r\n</ol>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">e. List Lagu Lomba Pop Religi</span></strong></h5>\r\n\r\n<ol>\r\n	<li>&nbsp;Aisyah Istri Rasulullah &ndash; Syakir Daulay</li>\r\n	<li>Denting &ndash; Melly Goeslaw</li>\r\n	<li>Cinta &ndash; Krisdayanti feat Melly Goeslaw</li>\r\n	<li>Hijrah Cinta &ndash; Rossa</li>\r\n	<li>Di Sepertiga Malam &ndash; Rey Mbayang</li>\r\n	<li>Takdir Cinta &ndash; Rossa</li>\r\n	<li>&nbsp;Ayat Ayat Cinta &ndash; Rossa</li>\r\n	<li>Takkan Berpaling Dari-Mu &ndash; Rossa</li>\r\n	<li>KuasaMu &ndash; Bunga Citra Lestari</li>\r\n	<li>Kupinang Kau Dengan Bismillah &ndash; Ungu feat Rossa</li>\r\n	<li>Shalawat Cinta &ndash; Ustad Jefri Al Bukhori</li>\r\n	<li>Bidadari Surga &ndash; Ustad Jefri Al Bukhori</li>\r\n	<li>KebesaranMu &ndash; ST12</li>\r\n	<li>MemujaMu &ndash; ST12</li>\r\n	<li>Seluruh Cinta &ndash; Siti Nurhaliza feat Cakra Khan</li>\r\n	<li>Jalan Cinta &ndash; Sherina</li>\r\n	<li>Rasool&#39;Allah &ndash; Harris J</li>\r\n	<li>Peace Be Upon You &ndash; Maher Zain</li>\r\n	<li>Baraka Allahu Lakuma &ndash; Maher Zain</li>\r\n	<li>Salam Alaikum &ndash; Harris J</li>\r\n	<li>I Promise &ndash; Harris J</li>\r\n	<li>You Are My Life &ndash; Harris J</li>\r\n	<li>Al Wabaa&#39; &ndash; Nissa Sabyan</li>\r\n	<li>Maulidu Ahmad &ndash; Syahla feat Nissa Sabyan</li>\r\n	<li>Allahul Kaafi &ndash; Fitriana feat Nissa Sabyan</li>\r\n	<li>Deen Assalam &ndash; Nissa Sabyan</li>\r\n	<li>Ya Jamalu &ndash; Nissa Sabyan</li>\r\n	<li>Ya Maulana &ndash; Nissa Sabyan</li>\r\n	<li>Ya Asyiqol &ndash; Nissa Sabyan</li>\r\n	<li>Syukran Lillah &ndash; Nissa Sabyan</li>\r\n	<li>Jangan Menyerah &ndash; D&rsquo;Masiv</li>\r\n	<li>Pintu Taubat &ndash; Zivilia</li>\r\n	<li>Cahaya Hati &ndash; Opick</li>\r\n	<li>Maha Melihat &ndash; Opick feat Amanda</li>\r\n	<li>Sajadah Panjang &ndash; Noah</li>\r\n	<li>Jalan Lurus &ndash; Gita Gutawa</li>\r\n	<li>Dengan NafasMu &ndash; Ungu</li>\r\n	<li>SurgaMu &ndash; Ungu</li>\r\n	<li>Bila Tiba &ndash; Ungu</li>\r\n	<li>Andai Ku Tahu &ndash; Ungu</li>\r\n	<li>Para PencariMu &ndash; Ungu</li>\r\n	<li>ud Of You Moslem &ndash; Fatin Shidqia</li>\r\n	<li>Keagungan Tuhan &ndash; Gigi</li>\r\n	<li>Ya Thoybah &ndash; Sulis</li>\r\n	<li>Sapu Jagat &ndash; Nissa Sabyan</li>\r\n	<li>Rindu Muhammadku &ndash; Haddad Alwi feat Vita</li>\r\n	<li>Bismillah Cinta &ndash; Ungu feat Lesti</li>\r\n	<li>Sepanjang Hidup &ndash; Maher Zain</li>\r\n	<li>Allahi Allah Kiya Karo &ndash; Maher Zain</li>\r\n	<li>man Ya Rohman &ndash; Nissa Sabyan</li>\r\n</ol>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">f. Ketentuan Kostum Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>\r\n	<h5><b>Putri :</b></h5>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Menutup Aurat.</p>\r\n		</li>\r\n		<li>\r\n		<p>Tidak diperkenankan menggunakan celana jeans ketat.</p>\r\n		</li>\r\n		<li>\r\n		<p>Tidak diperkenankan menggunakan kostum yang menerawang (transparan).</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h5><b>Putra :</b></h5>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Menutup Aurat</p>\r\n		</li>\r\n		<li>\r\n		<p>Tidak diperkenankan menggunakan celana yang ketat (press body)</p>\r\n		</li>\r\n		<li>\r\n		<p>Tidak di perkenankan menggunakan baju kaos ketat (press body)</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">g. Sistem Penilaian Lomba Pop Religi</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Vokal : 30 % ( Max 30 Poin )</li>\r\n	<li>Penghayatan/Penjiwaan : 20 % ( Max 20 Poin )</li>\r\n	<li>Teknik/Skill : 25 % ( Max 25 Poin )</li>\r\n	<li>Penguasaan Panggung : 10 % ( Max 10 Poin )</li>\r\n	<li>Penampilan/Kostum : 15 % ( Max 15 Poin )</li>\r\n</ol>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">h. Peraturan Lomba</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Peserta diminta untuk membuat kualitas video dan audio yang jelas,<br />\r\n	disarankan menggunakan microphone.</li>\r\n	<li>Peserta wajib mengikuti TM (Technical Meeting) sesuai dengan jadwal<br />\r\n	yang diinformasikan. Semua pertanyaan disetiap lomba akan dijawab<br />\r\n	langsung oleh Penanggung Jawab lomba di Technical meeting.</li>\r\n	<li>Durasi lomba 6 menit yang diawali dengan perkenalan peserta (Nama,<br />\r\n	Nomor urut, Asal Sekolah, dan sebutkan Judul lagu yang akan dibawakan)<br />\r\n	selanjutnya lomba bisa dimulai.</li>\r\n	<li>Waktu Perlombaan berdurasi 6 menit atau sesuai dengan kebutuhan durasi<br />\r\n	masing-masing peserta.</li>\r\n	<li>&nbsp;Peserta diharapkan mengambil video dalam One Take Shot (Sekali<br />\r\n	Pengambilan Video).</li>\r\n	<li>Peserta dilarang mengedit video cut dan sebagainya.</li>\r\n	<li>Setelah selesai, peserta dapat mengakhiri dengan salam.&nbsp;</li>\r\n</ol>',1,'2020-10-21 07:34:07','2021-12-16 08:25:20','pop-religi.jpg','pop-religi','SD, SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-12 00:00:00'),(4,'Tilawah','TILAWAH','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP/MTs Putra</li>\r\n	<li>SMP/MTs Putri</li>\r\n	<li>SMA/SMK/MA Putra</li>\r\n	<li>SMA/SMK/MA Putri</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP/MTs Putra : 25&nbsp;Peserta</li>\r\n	<li>SMP/MTs Putri : 25&nbsp;Peserta</li>\r\n	<li>SMA/SMK/MA Putra : 25&nbsp;Peserta</li>\r\n	<li>SMA/SMK/MA Putri : 25&nbsp;Peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP Putra/Putri :&nbsp;juz 1 - 10 juz</li>\r\n	<li>SMA Putra/Putri :&nbsp;juz 1 -&nbsp;20 juz</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Lomba</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi secara lengkap.</li>\r\n	<li>Peserta diharapkan mengikuti semua aturan yang berlaku di COMIC X.</li>\r\n	<li>Peserta wajib mengikuti TM (<em>Technical Meeting</em>) sesuai dengan jadwal yang diinformasikan. Semua pertanyaan disetiap lomba akan dijawab langsung oleh Penanggung Jawab lomba di Technical meeting.</li>\r\n	<li>Peserta diharapkan paham dan mengikuti semua peraturan di Lomba Tilawah.</li>\r\n	<li>Peserta diharapkan mengumpulkan video dengan tepat waktu.</li>\r\n	<li>Peserta memilih surah dan ayat sendiri dari Al-Qur&rsquo;an dengan ketentuan minimal 4 ayat dan maksimal 6 ayat.</li>\r\n	<li>Video yang dikirimkan ke <em>Website</em> COMIC X akan mutlak menjadi hak milik panitia.</li>\r\n	<li>Kualitas video yang dikirim harus jelas, disarankan video berkualitas 720p/HD atau 1080p/full HD.</li>\r\n	<li>Peserta diharuskan mengunggah video ke Google Drive masing-masing, kemudian mengunggah link Google Drive tersebut ke <em>Website</em> COMIC X. Untuk lebih jelas bisa melihat video penjelasannya di <em>Youtube, Instagram, </em>dan <em>Website</em> COMIC X.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">e. Kriteria penilaian</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Tajwid (<em>makharijul huruf, shifatul huruf, ahkamul huruf, ahkamul maddi wal qasr, dan ahkamul waqaf wal ibtida</em>&rsquo;).</li>\r\n	<li>Fashahah (Kefasihan).</li>\r\n	<li>Lagu, Irama, dan Suara.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">f. Point Penilaian</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Tajwid : 30 Point</li>\r\n	<li>Fashohah : 30 Point</li>\r\n	<li>Lagu dan irama&nbsp;: 25 Point</li>\r\n	<li>Suara : 15 Point</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">g. Peraturan Lomba</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Lomba Tilawah atau yang biasa kita kenal dengan MTQ (Musabaqah Tilawatil Qur&#39;an) adalah bidang lomba membaca Al-Qur&rsquo;an dengan bacaan mujawwad, yaitu bacaan Al-Qur&rsquo;an yang mengandung nilai ilmu membaca (tajwid), seni (lagu dan suara), dan etika (adab) membaca.</li>\r\n	<li>Durasi lomba 6 menit yang diawali dengan perkenalan peserta (Nama, Nomor urut, Asal Sekolah, dan sebutkan Surah serta ayat yang dibaca) selanjutnya Tilawah bisa dimulai.</li>\r\n	<li>Peserta bersifat perorangan.</li>\r\n	<li>Peserta dilarang lipsync.</li>\r\n	<li>Peserta diharapkan mengambil video dalam One Take Shot (sekali pengambilan video), Peserta dilarang mengedit video (seperti di <em>cut</em>, dsb).</li>\r\n	<li>Audio harus terdengar dengan jelas.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat pengeras suara, seperti<em> Microphone,</em> dsb.</li>\r\n	<li>Maqro&rsquo; akan dibagikan H-1 TM (<em>Technical Meeting</em>).</li>\r\n	<li>Peserta wajib berpakaian syar&rsquo;i\r\n	<ol>\r\n		<li>Laki &ndash; laki&nbsp;: rapi, memakai peci</li>\r\n		<li>Perempuan : rok, krudung.</li>\r\n	</ol>\r\n	</li>\r\n	<li>Semua Peralatan Lomba seperti Al-Quran, Kalam, dll disiapkan oleh peserta masing-masing.</li>\r\n</ol>\r\n\r\n<p><strong>h. FAQ</strong></p>\r\n\r\n<ol>\r\n	<li>BAGAIMANA JIKA PENGAMBILAN VIDEO TIDAK ONE TAKE SHOT CARA PENGAMBILAN VIDEONYA?<br />\r\n	<strong>JAWABANNYA:&nbsp;</strong><br />\r\n	TIDAK DIPERBOLEHKAN KARENA ITU SUDAH MENJADI PERATURAN UNTUK MENGHINDARI ADANYA KECURANGAN SEPERTI MENGEDIT VIDEO, CUT DLL.</li>\r\n	<li>BAGAIMANA JIKA VIDEO YANG DIKIRIMKAN KURANG BERKUALITAS?<br />\r\n	<strong>JAWABANNYA:</strong><br />\r\n	TIDAK MASALAH, YANG PENTING PESERTA MASIH BISA TERLIHAT DALAM VIDEO TERSEBUT. TETAPI DISARANKAN KUALITAS VIDEO 720p / HD.</li>\r\n	<li>BAGAIMANA JIKA MELEBIHI WAKTU YANG SUDAH DITENTUKAN?<br />\r\n	<strong>JAWABANNYA:</strong><br />\r\n	APABILA MELEBIHI WAKTU YANG SUDAH DITENTUKAN, MAKA ADA PENGURANGAN NILAI. TETAPI, KAMI MEMBERIKAN TOLERANSI 1 MENIT LEBIH DARI ITU MENDAPATKAN PENGURANGAN NILAI.</li>\r\n	<li>SEANDAINYA MENGGUNAKAN LEBIH DARI 3 NADA APAKAH BISA?<br />\r\n	<strong>JAWABANNYA:</strong><br />\r\n	TIDAK MASALAH, YANG PENTING SEMPURNA (TAJWID DAN FASHAHAH) DALAM PEMBACAANNYA.</li>\r\n	<li>BAGAIMANA TEKNIK PENJURIANNYA?<br />\r\n	<strong>JAWABANNYA:</strong><br />\r\n	TEKNIK PENJURIAN AKAN MEMAKAI JURI DARI KEMENAG DAN KAMI AKAN MEMANTU PENJURIANNYA. PENJURIAN TERSEBUT AKAN TRANSPARAN DAN AKAN DITAMPILKAN CUPLIKAN PROSES PENJURIAN.</li>\r\n</ol>',1,'2020-10-21 07:34:07','2022-01-12 11:54:08','tilawah.jpg','tilawah','SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-12 00:00:00'),(5,'Puisi Islami','PUISI','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP/Mts</li>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP/MTs : 30 peserta (Putra/Putri )</li>\r\n	<li>SMA/SMK/MA : 30 peserta (Putra/Putri )</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SMP/Mts : Pesan Kebaikan Untuk Sesama Umat.</li>\r\n	<li>SMA/SMK/MA : Bertaubat Sebelum Terlambat</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Perlombaan</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi secara lengkap.</li>\r\n	<li>Peserta diharapkan mengikuti semua aturan yang berlaku di COMIC X.</li>\r\n	<li>Peserta wajib mengikuti TM (<em>Technical Meeting</em>) sesuai dengan jadwal<br />\r\n	yang diinformasikan. Semua pertanyaan disetiap lomba akan dijawab<br />\r\n	langsung oleh Penanggung Jawab lomba di Technical meeting.</li>\r\n	<li>Perlombaan diadakan secara online dalam bentuk karya video.</li>\r\n	<li>Durasi berpuisi maksimal 5 menit.</li>\r\n	<li>Waktu 5 menit yang diawali dengan Perkenalan peserta (Salam, Nama,<br />\r\n	Nomor urut, Kategori, Asal Sekolah). Selanjutnya puisi bisa dimulai.</li>\r\n	<li>Peserta diwajibkan memakai bahasa yang baik dan sopan.</li>\r\n	<li>Peserta dilarang memakai kata-kata yang berbau rasis &amp; SARA.</li>\r\n	<li>Peserta dilarang <em>lipsync.</em></li>\r\n	<li>Peserta diwajibkan melakukan video tampak seluruh bagian anggota<br />\r\n	badan dari atas kepala sampai alas kaki.</li>\r\n	<li>Peserta diperbolehkan membaca teks.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat pengeras suara, seperti<br />\r\n	<em>Microphone</em>, dsb.</li>\r\n	<li>Kualitas video yang dikirim harus jelas, disarankan video berkualitas<br />\r\n	720p/HD atau 1080/<em>full</em>&nbsp;HD.</li>\r\n	<li>Hasil karya video Peserta di upload ke <em>Google Driv</em>e peserta masing-masing dan di Upload ke <em>Website </em>COMIC X.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">e. Durasi</span></strong></h5>\r\n\r\n<ul>\r\n	<li>5 Menit / Peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">f. Point - Point Penilaian Perlombaan</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Penghayatan : Penghayatan seorang pembaca puisi dapat dilihat dari<br />\r\n	pengunaan ekspresi menyesuaikan makna dari tiap kata dalam puisi yang<br />\r\n	ia bawakan. Penempatan mimik wajah yang tepat untuk setiap makna kata<br />\r\n	dalam puisi merupakan bagian dari penilaian dalam pembacaan puisi.</li>\r\n	<li>Penampilan : Penampilan dari segi busana yang rapi dan sikap percaya diri<br />\r\n	di depan panggung.</li>\r\n	<li>Intonasi : Intonasi yang tepat saat membacakan puisi akan memberikan<br />\r\n	penekanan pada makna yang hendak disampaikan dengan puisi. Naikturun nada menyesuaikan makna kata dalam setiap bait puisi menjadikan<br />\r\n	puisi lebih hidup.</li>\r\n	<li>Mimik : Mimik menjadi syarat wajib yang nilanya cukup tinggi, tanpa<br />\r\n	mimik atau ekspresi muka penghayatan kurang maksimal.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">g. Kategori Penilaian</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Penghayatan : 20%</li>\r\n	<li>Penampilan : 15%</li>\r\n	<li>Intonasi : 15%</li>\r\n	<li>Mimik : 20%</li>\r\n	<li>Kesesuaian dengan tema : 30%</li>\r\n</ul>',1,'2020-10-21 07:34:07','2021-12-16 09:19:46','puisi-islami.jpg','puisi-islami','SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-13 00:00:00'),(6,'Short Movie Islami','MOVIE','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMA/SMK/MA : 12 team</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>c. Tema Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Membangkitkan semangat pemuda-pemudi untuk mengamalkan budaya islami di masa pandemi.</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Teknis lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi lengkap.</li>\r\n	<li>Peserta mengikuti semua aturan yang berlaku di COMIC X.</li>\r\n	<li>Peserta wajib mengikuti <em>Technical Meeting</em> sesuai jadwal yang ditentukan.</li>\r\n	<li>Peserta dilarang menggunakan konten yang bersifat rasis dan sarkasme.</li>\r\n	<li>Durasi Short Movie Islami 12 menit sudah termasuk <em>credit title.</em></li>\r\n	<li>Kualitas video harus jelas, disarankan video berkualitas 720p/HD atau 1080/<em>full</em> HD.</li>\r\n	<li>Peserta diharuskan mengunggah video ke Google Drive masing-masing,<br />\r\n	kemudian mengunggah link<em> Google Drive </em>tersebut ke <em>Website </em>COMIC X.<br />\r\n	Untuk lebih jelas bisa melihat video penjelasannya di <em>YouTube, Instagram,</em><br />\r\n	dan <em>Website</em> COMIC X.</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>e. Aspek&nbsp;dan Poin Penilaian</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Keutuhan ide dan bentuk film (orisinalitas karya dan ide/pesan sesuai<br />\r\n	tema) : 30 poin</li>\r\n	<li>Akting (mimik (penghayatan) dan karakter) : 25 poin</li>\r\n	<li>Teknik pengambilan gambar (angle dan style (pencahayaan)) : 15 poin</li>\r\n	<li>Estetika (kualitas gambar/suara dan penataan artistik) : 10 poin</li>\r\n	<li>Video editing (teknik dan style editing) : 20 poin</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>f. Ketentuan Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Film berisi himbauan, seruan atau informasi sesuai tema yang ditentukan.</li>\r\n	<li>Film dikemas menarik, komunikatif, dan kreatif.</li>\r\n	<li>Tidak mengandung pesan negatif atau menyimpang dari norma dan tidak<br />\r\n	bersifat radikal.</li>\r\n	<li>Film tidak mengandung unsur rasisme dan sarkasme.</li>\r\n	<li>Film belum pernah diikutsertakan dalam kompetisi apapun (original).</li>\r\n	<li>Menggunakan <em>subtitle</em> Bahasa Indonesia (jika film menggunakan bahasa<br />\r\n	asing/daerah).</li>\r\n	<li>Satu team berisikan 5 orang.</li>\r\n	<li>Diperbolehkan memakai actor diluar team.</li>\r\n	<li>Durasi Short Movie Islami 12 menit.</li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:14px;\"><strong>g. Durasi Lomba</strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:12px;\">Durasi Short Movie Islami 12 menit.</span></li>\r\n</ul>',1,'2020-10-21 07:34:07','2021-12-16 09:22:08','short-movie-islami-OhRC.png','short-movie-islami','SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-13 00:00:00'),(7,'Desain Poster Islami','POSTER','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMP/MTS</li>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMP/MTS&nbsp;: 30 Peserta</li>\r\n	<li>SMA/SMK/MA&nbsp;: 30 Peserta</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>c. Tema</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Di Era Transisi, Generasi Pandemi Bisa Apa?</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Sub Tema</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Produktivitas</li>\r\n	<li>Pendidikan</li>\r\n	<li>Peran Reformasi Digital</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>e. Teknis Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Peserta sudah melakukan registrasi COMIC X secara lengkap.</li>\r\n	<li>Peserta diharapkan mengikuti semua aturan yang berlaku di COMIC X.</li>\r\n	<li>Peserta wajib mengikuti TM (<em>Technical Meeting</em>) sesuai dengan jadwal yang diinformasikan. Semua pertanyaan disetiap lomba akan dijawab<br />\r\n	langsung oleh Penanggung Jawab lomba di Technical Meeting.</li>\r\n	<li>Peserta diharapkan paham dan mengikuti semua peraturan di Lomba Desain Poster Islami.</li>\r\n	<li>Jika peserta melanggar peraturan yang sudah tertulis, maka akan dilakukan pengurangan point.</li>\r\n	<li>Peserta diharapkan mengumpulkan hasil karya dengan tepat waktu.</li>\r\n	<li>Peserta wajib mengunggah hasil karya posternya di akun media sosial<br />\r\n	Instagram dengan :&nbsp;- Caption :&nbsp;Nama : Indica Najatu Silva&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Asal Sekolah : SMA Muhammadiyah 1 Denpasar&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Tagar&nbsp; &nbsp; &nbsp;:&nbsp;#dpicomic2022 #comic2022 #comicmcos2022&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Mention :&nbsp;@comicstikombali @mcosbali</li>\r\n	<li>Durasi Short Movie Islami 12 menit sudah termasuk <em>credit title.</em></li>\r\n	<li>Peserta wajib mengunggah hasil karyanya di akun Instagram pribadi paling lambat Hari Sabtu, 19 Februari 2022.</li>\r\n	<li>Karya dibuat dengan ketentuan:\r\n	<ul>\r\n		<li>Resolusi : 300ppi</li>\r\n		<li>Ukuran : A4</li>\r\n		<li>Format : JPEG (Hasil Akhir)</li>\r\n		<li>Format : PSD, CDR, AI, LINK CANVA (Hasil Mentah)</li>\r\n		<li>Peserta mengumpul 2 file dalam 1 folder, yaitu file mentah (PSD,CDR, AI) dan file hasil akhir (JPEG) untuk Peserta yang menggunakan Software Adobe Photoshop, CorelDraw, dan Adobe Ilustrator.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Bagi peserta yang menggunakan Software Canva maka yang dikumpulkan&nbsp;adalah Hasil Akhir dalam format (JPEG), dan Link Hasil Desain Canva yang&nbsp;kemudian di Copy Link tersebut lalu di ubah menjadi format (PDF) dan dijadikan 1 folder.</li>\r\n	<li>File disimpan dalam 1 folder dengan nama folder (DPI)_(kategori)_(sekolah asal)_(nama lengkap peserta).</li>\r\n	<li>Contoh :\r\n	<ul>\r\n		<li>DPI_SMA_ SMA Muhammadiyah 1 Denpasar_Indica Najatu Silva</li>\r\n	</ul>\r\n	</li>\r\n	<li>Hasil karya yang dikirimkan ke Website COMIC X akan mutlak menjadi hak milik panitia.</li>\r\n	<li>Peserta diharuskan mengunggah hasil karyanya ke Google Drive masing masing, kemudian mengunggah link Google Drive tersebut ke Website COMIC X. Untuk penjelasan lebih jelas, bisa melihat video via YouTube, Instagram, dan Website COMIC X.</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>f. Point dan Presentasi Penilaian</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Originalitas (1-100) 20%</li>\r\n	<li>Konsep Ide Desain (1-100) 15%</li>\r\n	<li>Teknik Penggunaan Software (1-100) 20%</li>\r\n	<li>Nilai Estetika dan Komunikatif (1-100) 30%</li>\r\n	<li>Kesesuaian Tema (1-100) 15%</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>g. Peraturan</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Peserta merupakan perorangan.</li>\r\n	<li>Peserta hanya diperkenankan mengirim karya 1 buah poster saja.</li>\r\n	<li>Software yang digunakan adalah Adobe Photoshop, CorelDraw, Adobe Ilustrator dan Canva.</li>\r\n	<li>Desain dapat dibuat hanya dengan ilustrasi atau menggabungkan antara ilustrasi dengan foto (catatan: foto merupakan karya sendiri bukan karya<br />\r\n	orang lain).</li>\r\n	<li>Karya desain tidak boleh mengandung unsur yang bertentangan dengan peraturan perundang-undangan yang berlaku di Indonesia: kesusilaan, moral, kekerasan&nbsp;dan tidak mengandung unsur pornografi, serta bertentangan dengan SARA (Suku, Agama, dan RAS).</li>\r\n	<li>Karya yang dilombakan merupakan karya asli peserta dan belum pernah diikutsertakan atau dipublikasikan untuk keperluan yang bersifat komersil<br />\r\n	serta harus bebas dari setiap kontrak atau ikatan lain.</li>\r\n	<li>Apabila dikemudian hari terdapat gugatan hak cipta, pihak panitia tidak bertanggung jawab atas hal tersebut, panitia akan berasumsi bahwa seluruh<br />\r\n	desain yang diikutsertakan merupakan karya orisinil peserta.</li>\r\n	<li>Apabila ditemukan kecurangan dalam pelaksanaan lomba, maka peserta yang bersangkutan dinyatakan gugur.</li>\r\n</ul>',1,'2020-10-21 07:34:07','2021-12-16 10:31:25','desain-poster-islami.jpg','desain-poster-islami','SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-13 00:00:00'),(8,'Hadrah Al-Banjari','HADRAH','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SD/MI</li>\r\n	<li>SMP/MTs</li>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" style=\"list-style-type:disc\"><span style=\"color:#ffffff;\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">SD/MI</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">&nbsp;&nbsp;&nbsp; </span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">&nbsp;&nbsp;&nbsp; </span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><