ext-decoration:none\">سبحان اللّ</span></span></span></span><span style=\"color:#000000\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">ه </span></span></span></span></span></span><strong>(Subhanallah)</strong></li>\r\n		<li><span style=\"color:#ffffff;\"><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">اللّه اكبر</span></span></span></span></span></span><strong> (Allahuakbar</strong></li>\r\n		<li><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#ffffff;\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">ماشَآءاللّهُ</span></span></span></span><span style=\"color:#000000\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\"> </span></span></span></span></span></span><strong>(Masyaallah)</strong></li>\r\n	</ul>\r\n	</li>\r\n	<li>SD/MI B (Kelas 4, 5&nbsp;dan 6)\r\n	<ul>\r\n		<li><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#ffffff;\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">بسم الله الرحمن الرحيم</span></span></span></span><span style=\"color:#000000\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\"> </span></span></span></span></span></span><strong>(Bismillaahirrahmaanirrahiim)</strong></li>\r\n		<li><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#ffffff;\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">الحمد لله رب العالمين</span></span></span></span><span style=\"color:#000000\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\"> </span></span></span></span></span></span><strong>(Alhamdulillaahi Rabbil &lsquo;Aalamiin)</strong></li>\r\n		<li><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#ffffff;\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">لا إله إلا اللّٰه محمد رسول اللّٰ</span></span></span></span><span style=\"color:#000000\"><span style=\"font-weight:700\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">ه </span></span></span></span></span></span><strong>(Laillahailallah Muhammadarrasulullah)</strong></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Teknis Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi secara lengkap.</li>\r\n	<li>Para peserta diharapkan mengikuti semua aturan yang telah berlaku di COMIC X.</li>\r\n	<li>Peserta memilih salah satu lafadz, kemudian dibuat dengan ukuran kertas A3.</li>\r\n	<li>Peserta membuat video pendek dengan durasi 1 menit yang memperlihatkan peserta saat membuat kaligrafi dengan menggunakan pakaian yang rapi dan sopan.</li>\r\n	<li>Peserta mewarnai lafadz dengan warna hitam dan background berwarna putih.</li>\r\n	<li>Hasil gambar yang sudah diwarnai, kemudian discan dengan format pdf.</li>\r\n	<li>Ketentuan scannya yakni:\r\n	<ul>\r\n		<li>Scan Hasil karya Kaligrafinya.</li>\r\n		<li>Foto Peserta sedang memegang dan memperlihatkan karya Kaligrafinya.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Peserta diharuskan mengunggah video, Foto peserta bersama hasil gambar, dan hasil gambar yang sudah discan dalam 1 folder dengan nama folder (Lomba)_(Kategori)_(Nama Lengkap)_(Asal Sekolah) contoh: Kaligrafi_SD/MI A_Vriescania Intan_MII Klungkung ke google drive masing-masing, kemudian link dari google drive tersebut di kirim ke website COMIC X. Untuk penjelasan lebih jelas bisa melihat video di Youtube, Instagram, dan Website COMIC X.</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>e. Kriteria Penilaian</strong></span></h5>\r\n\r\n<ol>\r\n	<li>Proporsi huruf : 25%</li>\r\n	<li>Ketepatan lafadz : 25%</li>\r\n	<li>Jarak spasi dan Letak huruf : 20%</li>\r\n	<li>Keserasian dan Kerapian : 20%</li>\r\n	<li>Kekreatifan : 10%</li>\r\n</ol>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>f. Peraturan Lomba</strong></span></h5>\r\n\r\n<ol>\r\n	<li>Peserta tidak diperbolehkan untuk meminta bantuan pada siapapun dalam bentuk apapun.</li>\r\n	<li>Semua peralatan kaligrafi, seperti kertas, krayon, spidol, pensil warna dan alat-alat tulis lainnya dipersiapkan oleh peserta masing-masing.</li>\r\n	<li>Peserta tidak diperkenankan untuk mengedit video.</li>\r\n	<li>Kualitas video harus jelas.</li>\r\n</ol>',1,'2021-12-06 16:26:37','2021-12-16 09:39:29','kaligrafi.jpg','kaligrafi','SD',NULL,NULL,'2021-12-06 17:26:36','2021-12-06 17:26:36'),(10,'Fashion Desain Islami','FASHION','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota Peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SMA/SMK/MA : 30 Peserta</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>c. Tema Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Kreativitas Dalam Memadukan Keindahan Indonesia</li>\r\n	<li><strong>Sub Tema</strong>\r\n	<ul>\r\n		<li>Keterampilan</li>\r\n		<li>Keindahan</li>\r\n		<li>Religius</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Teknis Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Peserta merupakan perorangan.</li>\r\n	<li>Peserta hanya diperkenankan mengirim karya 1 buah design saja dan 1 buah penjelasan mengenai sketsa dan ide dalam perlombaan ini.</li>\r\n	<li>Software yang digunakan adalah Adobe Photoshop, CorelDraw, Adobe Ilustrator, dan Inkscape.</li>\r\n	<li>Semua sketsa desain harus merefleksikan kesatuan tema dan tidak lepas dari tema utama.</li>\r\n	<li>Menjelaskan secara singkat Desain Sketsa dan Ide yang dituangkan dalam perlombaan ini, dikumpulkan dalam bentuk pdf.</li>\r\n	<li>Peserta wajib mengunggah hasil karya posternya di akun media sosial Instagram (akun tidak di Private) dengan mencantumkan tagar #FashionDesainCOMICX #comic2022 #comicmcos2022 pada caption dan mention akun @comicstikombali @mcosbali</li>\r\n	<li>Karya dibuat dengan ketentuan:\r\n	<ul>\r\n		<li>Resolusi: 300 ppi</li>\r\n		<li>Ukuran: A3</li>\r\n		<li>Format: JPEG (Hasil Akhir)</li>\r\n		<li>Format: JPEG (Sketsa)</li>\r\n		<li>Format: PSD, CDR, AI, INKSCAPE (Proses Digital)</li>\r\n		<li>File disimpan dalam 1 folder dengan nama folder,&nbsp;Contoh: Fashion Desain_SMAN I_MUHAMMAD_SABIL</li>\r\n	</ul>\r\n	</li>\r\n	<li>Peserta diharuskan mengunggah Karya ke Google Drive masing-masing, kemudian mengunggah link Google Drive tersebut ke Website COMIC X. Untuk lebih jelas bisa melihat video penjelasannya di YouTube, Instagram, dan Website COMIC X.</li>\r\n	<li>Desain dapat dibuat hanya dengan ilustrasi atau menggabungkan antara ilustrasi dengan foto (catatan: foto merupakan karya sendiri bukan karya orang lain).</li>\r\n	<li>Peserta tidak diperbolehkan menggunakan fasilitas internet ketika perlombaan berlangsung (wi-fi, modem&nbsp;dan jenis lainnya).</li>\r\n	<li>Karya desain tidak boleh mengandung unsur yang bertentangan dengan peraturan perundang-undangan yang berlaku di Indonesia: kesusilaan, moral, kekerasan dan tidak mengandung unsur pornografi, serta bertentangan dengan SARA (Suku, Agama, dan RAS).</li>\r\n	<li>Karya yang dilombakan merupakan karya asli peserta dan belum pernah diikut sertakan atau dipublikasikan untuk keperluan yang bersifat komersil serta harus bebas dari setiap kontrak atau ikatan lain.</li>\r\n	<li>Apabila dikemudian hari terdapat gugatan hak cipta, pihak panitia tidak bertanggung jawab atas hal tersebut, panitia akan berasumsi bahwa seluruh desain yang diikutsertakan merupakan karya orisinil peserta.</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>e, Point Presentasse Penilaian</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Originalitas Desain : (1-100) 20%</li>\r\n	<li>Penggunaan Software : (1-100) 15%</li>\r\n	<li>Teknis Kombinasi Paduan Warna : (1-100) 20%</li>\r\n	<li>Nilai estetik/keindahan : (1-100) 25%</li>\r\n	<li>Kesesuaian Tema : (1-100) 20%</li>\r\n</ul>',1,'2021-12-06 16:26:37','2021-12-16 09:47:57','fashion-design-alt.jpg','fashion-design-islami','SMA',NULL,NULL,'2021-12-06 17:26:36','2021-12-06 17:26:36');
