INSERT INTO `faqs` (`id`, `user_id`, `question`, `answer`, `status`, `competition_type_id`, `answer_id`, `answer_time`, `created_at`, `updated_at`) VALUES (1,2,'Apakah peserta harus mengirimkan naskah Da’i yang telah dibuat?','<p><span lang=\"IN\" style=\"font-size:12.0pt;line-height:\r\n107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">Untuk para peserta tidak perlu mengirimkan naskah Da&rsquo;i yang telah dibuat oleh peserta. </span></p>',1,2,2,'2022-01-12 16:00:52','2022-01-12 09:00:52','2022-01-12 09:00:52'),(2,2,'Bagaimana jika pengambilan video tidak one take shot cara pengambilan videonya?','<p><span style=\"color:#000000;\">Tidak diperbolehkan, karena itu sudah menjadi peraturan untuk menghindari adanya kecurangan seperti mengedit video, cut, dll.</span></p>',1,4,2,'2022-01-12 19:30:04','2022-01-12 12:06:53','2022-01-12 12:30:04'),(3,2,'Bagaimana jika video yang dikirimkan kurang berkualitas?','<p>Tidak masalah, yang penting peserta masih bisa terlihat dalam video tersebut. Tetapi disarankan kualitas video 720p/HD.</p>',1,4,2,'2022-01-12 19:29:56','2022-01-12 12:11:17','2022-01-12 12:29:56'),(4,2,'Bagaimana jika melebihi waktu yang sudah ditentukan?','<p>Apabila melebihi waktu yang sudah ditentukan, maka ada pengurangan nilai. Tetapi, kami memberikan toleransi 1 menit lebih dari itu mendapatkan pengurangan nilai.</p>',1,4,2,'2022-01-12 19:24:51','2022-01-12 12:13:25','2022-01-12 12:24:51'),(5,2,'Seandainya menggunakan lebih dari 3 nada apakah bisa?','<p>Tidak masalah, yang penting sempurna (Tajwid dan Fashahah) dalam pembacaannya.</p>',1,4,2,'2022-01-12 19:25:38','2022-01-12 12:14:28','2022-01-12 12:25:38'),(6,2,'Bagaimana teknik penjuriannya?','<p>Teknik penjurian akan memakai juri dari kemenag dan kami akan memantau penjuriannya. Penjurian tersebut akan transparan dan akan ditampilkan cuplikan proses penjurian.</p>',1,4,2,'2022-01-12 19:26:10','2022-01-12 12:14:50','2022-01-12 12:26:10'),(7,2,'Bagaimana dengan kostum yang harus dipakai peserta?','<p>Untuk kostum disarankan menggunakan pakaian muslim rapi dan tidak menyulitkan peserta saat take (pengambilan video)</p>',-1,NULL,2,'2022-01-12 19:18:47','2022-01-12 12:18:47','2022-01-12 12:18:54'),(8,2,'Bagaimana dengan kostum yang harus dipakai peserta?','<p>Untuk kostum disarankan menggunakan pakaian muslim rapi dan tidak menyulitkan peserta saat take (pengambilan video).</p>',1,5,2,'2022-01-12 19:19:46','2022-01-12 12:19:46','2022-01-12 12:19:46'),(9,2,'Apakah ada aturan untuk mewarnai designnya?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Tidak ada, untuk warna bisa disesuaikan dengan karya yang dibuat oleh masing - masing peserta</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:27:03','2022-01-12 12:20:48','2022-01-12 12:27:03'),(10,2,'Apakah peserta diperbolehkan berhias(dandan)?','<p>Peserta hanya boleh memakai bedak sekedarnya, dan tidak boleh memakai lipstick.</p>',1,5,2,'2022-01-12 19:21:27','2022-01-12 12:21:27','2022-01-12 12:21:27'),(11,2,'Apakah karya harus di upload di instagram pribadi?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Iya, jika dari peserta menggunakan second account atau akun palsu maka akan ada konsekuensi yang akan diterima</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:21:49','2022-01-12 12:21:49','2022-01-12 12:21:49'),(12,2,'Bagaimana posisi video saat mengambil video?','<p>Posisi video disarankan landscape, agar peserta leluasa dalam mengekspresikan puisi yang peserta bawakan.</p>',1,5,2,'2022-01-12 19:22:10','2022-01-12 12:22:10','2022-01-12 12:22:10'),(13,2,'Bagaimana posisi peserta saat take atau pengambilan video?','<p>Posisi peserta saat take disarankan berdiri, yang terpenting gerakan serta mimiknya terlihat jelas.</p>',1,5,2,'2022-01-12 19:22:48','2022-01-12 12:22:48','2022-01-12 12:22:48'),(14,2,'Apakah peserta boleh menggunakan software selain yang di sarankan oleh panitia?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">tidak boleh, software yang digunakan hanya yang disarankan oleh panitia saja</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:23:06','2022-01-12 12:23:06','2022-01-12 12:23:06'),(15,2,'Apakah peserta diperbolehkan merekam menggunakan handphone ?','<p>Boleh, yang terpenting adalah kualitas video dan audionya baik dan jelas</p>',1,5,2,'2022-01-12 19:23:24','2022-01-12 12:23:24','2022-01-12 12:23:24'),(16,2,'Didalam Sub tema terdapat Ketrampilan, Keindahan, Religius. Coba bisa di jelaskan maksud dari ketiga Sub Tema tersebut!','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">maksud dari ketiga sub tersebut adalah, peserta menggabungkan nilai dari ketrampilan, keindahan dan religius dalam karya yang akan dibuat nanti</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:23:51','2022-01-12 12:23:51','2022-01-12 12:23:51'),(17,2,'Apakah peserta boleh membaca teks?','<p>Tidak, peserta diharuskan untuk menghafalkannya terlebih dahulu.&nbsp;</p>',1,5,2,'2022-01-12 19:23:58','2022-01-12 12:23:58','2022-01-12 12:23:58'),(18,2,'Apakah video boleh diedit?','<p>Tidak, video yang dikirimkan/diupload haruslah video asli tanpa edit dan lain sebagainya. Maka dari itu harus dipersiapkan dengan matang teknis atau alat-alat dalam pengambilan video.</p>',1,5,2,'2022-01-12 19:24:30','2022-01-12 12:24:30','2022-01-12 12:24:30'),(19,2,'Untuk di sub tema apakah kita harus memilih salah satu atau kita mengabungkan ketiga sub tema tersebut?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">harus menggabungkan</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:24:39','2022-01-12 12:24:39','2022-01-12 12:24:39'),(20,2,'Berapa kali video boleh dikirimkan?','<p>Link video hanya boleh 1 kali di upload atau unggah ke website comic.</p>',1,5,2,'2022-01-12 19:25:06','2022-01-12 12:25:06','2022-01-12 12:25:06'),(21,2,'Apakah ada batasan dalam pembuatan penjelasan secara singkat desain sketsa dan ide yang di buat?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">untuk penjelasannnya tidak ada batasan, tapi bisa dibuat sesingkat dan sejelas mungkin</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:25:19','2022-01-12 12:25:19','2022-01-12 12:25:19'),(22,2,'Apakah boleh menggunakan instrument ?','<p>Diperbolehkan menggunakan instrument.</p>',1,5,2,'2022-01-12 19:25:32','2022-01-12 12:25:32','2022-01-12 12:25:32'),(23,2,'Apakah kita boleh melihat Referensi desain di internet?','<p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">boleh, tetapi jika kedapatan peserta menggunakan karya yang ada pada internet akan kita diskualifikasi langsung</span></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>',1,10,2,'2022-01-12 19:25:53','2022-01-12 12:25:53','2022-01-12 12:25:53'),(24,81,'cara daftar','<p>Untuk cara pendaftaran peserta bisa langsung melihat/menonton video tutorial yang sudah di upload di web (dibagian Panduan),&nbsp;instagram (@comicstikombali), dan di youtube (MCOS&nbsp;bali).</p>',1,NULL,2,'2022-01-14 09:42:55','2022-01-13 05:56:33','2022-01-14 02:42:55'),(25,2,'Apakah Video boleh di edit ?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Video dilarang untuk diedit.</span></span></span></p>',1,1,2,'2022-01-14 09:56:00','2022-01-14 02:56:00','2022-01-14 02:56:00'),(26,2,'Berapa kali video boleh dikirim ?','<p>Setiap peserta hanya diperbolehkan satu kali mengirim atau upload video.</p>',1,1,2,'2022-01-14 10:09:37','2022-01-14 03:05:09','2022-01-14 03:09:37'),(27,2,'Apakah diperbolehkan menggunakan baju bebas rapih ?','<p>Mohon diusahakan menggunakan pakaian muslim yang rapih.</p>',1,1,2,'2022-01-14 10:10:49','2022-01-14 03:10:49','2022-01-14 03:10:49'),(28,2,'Adzan apa saja yang digunakan dalam video ?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Peserta lomba diwajibkan menggunakan ADZAN SHUBUH.</span></span></span></p>',1,1,2,'2022-01-14 10:11:34','2022-01-14 03:11:34','2022-01-14 03:11:34'),(29,2,'Apakah irama adzan bebas ?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Irama adzan bebas dipilih oleh peserta.</span></span></span></p>',1,1,2,'2022-01-14 10:12:13','2022-01-14 03:12:13','2022-01-14 03:12:13'),(30,2,'Bentuk video yang dikirim Potrait atau Landscape ?','<p>Bentuk video landscape (horizontal)</p>',1,1,2,'2022-01-14 10:12:47','2022-01-14 03:12:47','2022-01-14 03:12:47'),(31,2,'Apa kualitas video yang dikirim ?','<p>Kualitas video yang dikirim disarankan 720/1080p untuk mempermudah juri dalam melakukan penilaian.</p>',1,1,2,'2022-01-14 10:13:44','2022-01-14 03:13:44','2022-01-14 03:13:44'),(32,2,'Apakah diperbolehkan dubbing atau lipsync?','<p>Jika terkonfirmasi dan diketahui melakukan hal tersebut, peserta akan didiskualifikasi.</p>',1,1,2,'2022-01-14 10:14:13','2022-01-14 03:14:13','2022-01-14 03:14:13'),(33,2,'Jika peserta ingin menambahkan bahasa selain bahasa Indonesia , apakah diperbolehkan?','<p style=\"margin-left:96px; text-align:justify; text-indent:-50.7pt; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Diperbolehkan, dakwah boleh &nbsp;dikreasikan selain bahasa Indonesia. Namun ketika&nbsp; dilafadzkan langsung disertakan juga artinya menggunakan bahasa Indonesia yang baik dan benar.</span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:25:19','2022-01-14 03:25:19','2022-01-14 03:25:19'),(34,2,'Jika waktu yang disediakan maksimal 6 menit, berapakah waktu untuk minimal dalam membuat video?','<p style=\"margin-left:28px; text-align:justify; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Untuk minimal dalam pembuatan video Da&rsquo;i diberikan minimal waktu 4 menit, dan maksimal 6 menit.</span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:25:55','2022-01-14 03:25:55','2022-01-14 03:25:55'),(35,2,'Apakah diperbolehkan merekam video menggunakan handphone?','<p style=\"margin-left:28px; text-align:justify; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Peserta diperbolehkan merekam menggunakan handphone</span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:26:27','2022-01-14 03:26:27','2022-01-14 03:26:27'),(36,2,'Bagaimana posisi frame saat dalam pembuatan video, apakah harus full badan atau setengah badan ?','<p style=\"margin-left:96px; text-align:justify; text-indent:-51.0pt; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Diharuskan menggunakan posisi frame landscape, agar peserta lebih leluasa untuk bergaya dan berekspresi. Peserta diperbolehkan untuk memilih full badan atau setengah badan, tetapi poin yang terpenting adalah audio(suara) peserta tetap terdengar dengan jelas. </span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:27:01','2022-01-14 03:27:01','2022-01-14 03:27:01'),(37,2,'Apakah peserta boleh menambah instrumen dalam video ?','<p style=\"margin-left:96px; text-align:justify; text-indent:-50.7pt; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tidak diperkenankan peserta menambahkan instrumen, karena didalam peraturan&nbsp; tidak diizinkan untuk melakukan pengeditan video .</span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:27:42','2022-01-14 03:27:42','2022-01-14 03:27:42'),(38,2,'Apakah peserta lomba Da’i wajib menggunakan microphone?','<p style=\"margin-left:96px; text-align:justify; text-indent:-51.0pt; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Peserta tidak </span></span></span><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">di</span></span></span><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">wajib</span></span></span><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">kan </span></span></span><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">menggunakan microphone</span></span></span><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. Penggunaan microphone&nbsp;&nbsp; hanya sebagai alat pengeras suara agar audio (suara) terdengar dengan jelas. Penggunaan microphone atau tidaknya, tidak menambah atau mengurangi poin dalam penilaian.</span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:29:10','2022-01-14 03:29:10','2022-01-14 03:29:10'),(39,2,'Apakah boleh peserta menggunakan microphone yang langsung terkoneksi ke handphone dan kamera ?','<p>Boleh, namun tidak diperbolehkan mixing ataupun editing video.</p>',1,2,2,'2022-01-14 10:30:06','2022-01-14 03:30:06','2022-01-14 03:30:06'),(40,2,'Apa yang dimaksud dengan One Take Shot?','<p>Konsep pengambilan gambar atau video hanya satu kali pengambilan saja</p>',1,2,2,'2022-01-14 10:30:34','2022-01-14 03:30:34','2022-01-14 03:30:34'),(41,2,'Apakah boleh peserta melakukan dialog dua sisi seperti berdialog ke orang-orang atau  penonton?','<p style=\"margin-left:96px; text-align:justify; text-indent:-51.0pt; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:115%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Boleh, peserta diperbolehkan melaukan dialog 1 sisi (arah) maupun 2 sisi (arah) layaknya tampil dihadapan orang-orang&nbsp; (audience), namun kamera tetap menghadap ke peserta. </span></span></span></span></span></span></p>',1,2,2,'2022-01-14 10:31:12','2022-01-14 03:31:12','2022-01-14 03:31:12'),(42,2,'Apakah ada penilaian dalam pengambilan vidio?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Tidak ada penilaian dalam pengambilan vidio.</span></span></span></p>',1,8,2,'2022-01-14 11:06:35','2022-01-14 04:06:35','2022-01-14 04:06:35'),(43,2,'Apakah boleh memakai Tarian Koreografi di saat lomba berlangsung?','<p>Jikapun ada yang menggunakan di saat perlombaan berlangsung, Tarian Koreografi tidak akan masuk dalam penilaian.</p>',1,8,2,'2022-01-14 11:07:06','2022-01-14 04:07:06','2022-01-14 04:07:06'),(44,2,'Apakah alat kontemporer, calti, dll boleh digunakan?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Alat hadrah yang boleh digunakan 4 terbangngan, 1 bass murni/dumbuk, jikapun ada yang menggunakan alat hadrah seperti kontemporer, calti, dll tidak akan masuk dalam penilaian.</span></span></span></p>',1,8,2,'2022-01-14 11:07:28','2022-01-14 04:07:28','2022-01-14 04:07:28'),(45,2,'Waktunya bisa ditambah lagi?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Untuk waktu kami tetapkan 8 menit diawali dengan perkenalan lanjut dengan jingle dan kemudian melantunkan Shalawat</span></span></span></p>',1,8,2,'2022-01-14 11:07:50','2022-01-14 04:07:50','2022-01-14 04:07:50'),(46,2,'Pengurangan nilai jika melebihi batas waktu, karena biasanya lomba al-banjari itu kalau melebihi waktu pengurangannya 5 poin?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">Pengurangan nanti dalam penilaian tergantung kebijakan dewan hakim</span></span></span></p>',1,8,2,'2022-01-14 11:08:14','2022-01-14 04:08:14','2022-01-14 04:08:14'),(47,2,'Apakah semua peserta lomba Pop Religi wajib menggunakan Microphone?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Dikarenakan lomba pop religi merekam full body / seluruh badan, diusahakan menggunakan Microphone agar kualitas suara lebih baik.Dikarenakan lomba pop religi merekam full body / seluruh badan, diusahakan menggunakan Microphone agar kualitas suara lebih baik.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:05:37','2022-01-14 14:05:37','2022-01-14 14:05:37'),(48,2,'Apakah penggunaan Microphone menjadi salah satu penambahan point dalam penilaian?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tidak, Peserta diperbolehkan menggunakan microphone sebagai alat pengeras dan memperjelas suara, namun tidak menambah point dalam penilaian.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:06:02','2022-01-14 14:06:02','2022-01-14 14:06:02'),(49,2,'Bagaimana posisi peserta dalam frame video?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Disarankan full body, dikarenakan terdapat penilaian kostum atau busana dan penguasaan panggung dan diharap untuk memperhatikan kualitas suara kembali.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:06:23','2022-01-14 14:06:23','2022-01-14 14:06:23'),(50,2,'Bagaimana posisi frame saat pengambilan video?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Disarankan menggunakan posisi frame landscape, agar peserta lebih leluasa untuk bergaya dan berekspresi.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:06:44','2022-01-14 14:06:44','2022-01-14 14:06:44'),(51,2,'Apa yang dimaksud One Take Shot?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Konsep pengambilan gambar/video dalam satu kali pengambilan saja.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:07:04','2022-01-14 14:07:04','2022-01-14 14:07:04'),(52,2,'Apa diperbolehkan merekam menggunakan handphone?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Peserta diperbolehkan merekam menggunakan handphone, tetapi harus jelas</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:07:29','2022-01-14 14:07:29','2022-01-14 14:07:29'),(53,2,'Apakah peserta diperbolehkan memakai microphone yang langsung terkoneksi ke Handphone dan Kamera?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Boleh, namun tidak diperbolehkan mixing ataupun editing video</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:08:01','2022-01-14 14:08:01','2022-01-14 14:08:01'),(54,2,'Apa perserta diperbolehkan nyanyi sambil memainkan alat musik?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Boleh saja, yang terpenting suara vocal terdengar dengan jelas dan sesuai dengan lagu yang dipilih. Point yang dinilai yakni vocal bukan instrumen. </span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:08:19','2022-01-14 14:08:19','2022-01-14 14:08:19'),(55,2,'Apa diharuskan memakai alas kaki sewaktu take video?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"tab-stops:1.0cm\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Disarankan memakai, karena nantinya video akan nampak </span></span></span><span lang=\"IN\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">seluruh bagian anggota badan dari atas kepala sampai alas kaki.</span></span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:08:38','2022-01-14 14:08:38','2022-01-14 14:08:38'),(56,2,'Apakah peserta diperbolehkan sambil duduk?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Boleh, senyamannya saja asalkan tidak menganggu atau mempengaruhi vocal saat bernyanyi.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 21:08:58','2022-01-14 14:08:58','2022-01-14 14:08:58'),(57,2,'Apakah Diperbolehkan menggunakan bahasa asing/daerah?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Diperbolehkan, dalam peraturan dibolehkan menggunakan bahasa asing/daerah, tetapi&nbsp;</span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">wajib disertai dengan subtitle bahasa indonesia.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:10:53','2022-01-14 14:10:53','2022-01-14 14:10:53'),(58,2,'Apakah di dalam video boleh menyebut/berisi hadist, ayat al-qur\'an dan sejenisnya?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Diperbolehkan selama digunakan sebagai informasi, seruan, himbauan, bukan untuk&nbsp;</span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">menyinggung sara.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:11:28','2022-01-14 14:11:28','2022-01-14 14:11:28'),(59,2,'Dimana tempat upload Video?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Berdasarkan teknis lomba, Peserta diharuskan mengupload video ke google drive</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">masing - masing, kemudian mengupload link Google Drive tersebut ke Website</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">COMIC X : www.comic-stikombali.com selain itu, tidak diperkenankan karena tidak</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">akan masuk penilaian.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:21:44','2022-01-14 14:21:44','2022-01-14 14:21:44'),(60,2,'Apakah diperbolehkan menggunakan aktor di luar team?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Diperbolehkan, karena aktor tidak masuk pada penilaian, kecuali, pengkhayatan/pendalaman karakter aktor akan dihitung sebagai point penilaian.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:22:43','2022-01-14 14:22:43','2022-01-14 14:22:43'),(61,2,'Bolehkah menggunakan film yang telah dibuat sebelum COMIC?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Diperbolehkan, asal belum pernah diikutsertakan dalam kompetisi apapun</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">sebelumnya dan bersifat original.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:24:53','2022-01-14 14:24:53','2022-01-14 14:24:53'),(62,2,'Apakah di perbolehkan menggunakan Backsound/lagu milik orang lain?','<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Ya, Boleh. tetapi dengan syarat menyertakan keterangan lagu di credit title dan&nbsp;</span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">tanggung jawab atas hak cipta lagu bukan menjadi bagian tanggung jawab Panitia COMIC.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:25:34','2022-01-14 14:25:34','2022-01-14 14:25:34'),(63,2,'Apakah diperbolehkan menggunakan template desain orang lain?','<p style=\"margin-left:24px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Boleh. Tetapi tidak diperbolehkan untuk keseluruhan video dan sertakan juga credit title. Panitia COMIC tidak bertanggung jawab atas hak cipta.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:26:25','2022-01-14 14:26:25','2022-01-14 14:26:25'),(64,2,'Apakah durasi short movie boleh kurang dari 10 menit?','<p style=\"margin-left:24px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Tidak. Durasi minimal dan maksimal short movie harus 12 menit. Jika ada lebih dalam detik maka diperbolehkan tetapi jika lebih ataupun kurang dalam menit tidak diperbolehkan.</span></span></span></span></span></span></p>',1,6,2,'2022-01-19 15:20:57','2022-01-14 14:27:49','2022-01-19 08:20:57'),(65,2,'Apakah diperbolehkan untuk mengusung tema budaya islami tetapi merupakan budaya luar negeri?','<p style=\"margin-left:24px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"text-justify:inter-ideograph\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\">Boleh. Tetapi tetap yang diutamakan adalah budaya di Indonesia, itu juga merupakan poin penting dalam tahap penilaian.</span></span></span></span></span></span></p>',1,6,2,'2022-01-14 21:28:46','2022-01-14 14:28:46','2022-01-14 14:28:46'),(66,2,'Apakah harus mengunggah hasil karya di media social(Instagram) pribadi?','<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Ya harus, karena itu bagian wajib dari teknis perlombaan DPI</span></span></span></p>',1,7,2,'2022-01-14 21:31:55','2022-01-14 14:31:55','2022-01-14 14:31:55'),(67,2,'Apakah penentuan pemenang ditentukan dari like terbanyak di Instagram?','<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Tidak, Panitia menentukan pemenang berdasarkan kriteria berikut: - Originalitas -</span></span></span><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Konsep Desain - Teknik Penggunaan Software - Nilai Estetika dan Komunikatif -</span></span></span><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Kesesuaian Tema</span></span></span></p>',1,7,2,'2022-01-14 21:33:06','2022-01-14 14:33:06','2022-01-14 14:33:06'),(68,2,'Apakah tidak boleh menggunakan aplikasi selain CorelDRAW, Ilustrator, Photoshop?','<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Tidak boleh, karena Aplikasi yang kami tentukan itu aplikasi yang umum digunakan&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">para desainer, dan penggunaan software juga termasuk dari kriteria penilaian. Jadi&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">dimohon untuk peserta tidak menggunakan aplikasi diluar yang kami tentukan.</span></span></span></p>',1,7,2,'2022-01-14 21:34:22','2022-01-14 14:34:22','2022-01-14 14:34:22'),(69,2,'Apakah desain poster harus berwarna?','<p><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">Ya harus, karna dari warna inilah yang berfungsi untuk pengarah kepada pembaca&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"line-height:115%\"><span style=\"font-family:Arial,sans-serif\">mengenai informasi yang ada pada posternya.</span></span></span></p>',1,7,2,'2022-01-14 21:35:20','2022-01-14 14:35:20','2022-01-14 14:35:20'),(70,2,'Apakah peserta boleh menggunakan kertas selain A3?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesuai dengan ketentuan yang kami buat bahwa untuk karya dibuat di kertas A3. </span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:37:33','2022-01-14 14:37:33','2022-01-14 14:37:33'),(71,2,'Apakah peserta harus membuat video saat membuat karya?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ya, untuk meminimalisir terjadinya kecurangan, maka peserta diharuskan untuk membuat video saat membuat karya.</span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:38:37','2022-01-14 14:38:37','2022-01-14 14:38:37'),(72,2,'Mengapa warna karya yang digunakan berwarna hitam?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Karena sistem penilaian kita nantinya secara online dimana warna hitam yang cukup jelas dilihat ketika discan dan lebih cocok digunakan untuk mewarnai kalimat yang berhubungan dengan Allah SWT. </span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:39:36','2022-01-14 14:39:36','2022-01-14 14:39:36'),(73,2,'Apakah peserta boleh mengirimkan lebih dari 1 karya?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tidak, peserta hanya diperbolehkan mengirim 1 hasil karya saja.</span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:40:02','2022-01-14 14:40:02','2022-01-14 14:40:02'),(74,2,'Apakah peserta boleh mengirimkan karya yang pernah diikut sertakan di lomba lain?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tidak, karya yang dibuat harus baru dan tidak pernah diikut sertakan di lomba lain.</span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:41:28','2022-01-14 14:41:28','2022-01-14 14:41:28'),(75,2,'Bagaimana dengan media yang digunakan untuk membuat video?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Untuk media yang digunakan boleh menggunakan handphone dan kualitas video harus jelas.</span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:42:03','2022-01-14 14:42:03','2022-01-14 14:42:03'),(76,2,'Mengapa peserta tidak diperbolehkan untuk mengedit video?','<p style=\"margin-bottom:11px; margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"line-height:150%\"><span style=\"font-family:Calibri,sans-serif\"><span lang=\"EN-US\" style=\"font-size:12.0pt\"><span style=\"line-height:150%\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Karena sesuai dengan ketentuan yang kami buat, kami ingin melihat video real dari peserta yang membuat karya.</span></span></span></span></span></span></p>',1,9,2,'2022-01-14 21:42:33','2022-01-14 14:42:33','2022-01-14 14:42:33'),(77,2,'Apakah semua peserta lomba Pop Religi wajib menggunakan Microphone?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Dikarenakan lomba pop religi merekam full body / seluruh badan, diusahakan menggunakan Microphone agar kualitas suara lebih baik</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:39:22','2022-01-14 15:38:26','2022-01-14 15:39:22'),(78,2,'Apakah penggunaan Microphone menjadi salah satu penambahan point dalam penilaian?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Tidak, Peserta diperbolehkan menggunakan microphone sebagai alat pengeras dan memperjelas suara, namun tidak menambah point dalam penilaian.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:41:34','2022-01-14 15:41:34','2022-01-14 15:41:34'),(79,2,'Bagaimana posisi peserta dalam frame video?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Disarankan full body, dikarenakan terdapat penilaian kostum atau busana dan penguasaan panggung dan diharap untuk memperhatikan kualitas suara kembali.</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:42:25','2022-01-14 15:42:25','2022-01-14 15:42:25'),(80,2,'4. Bagaimana posisi frame saat pengambilan video?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Disarankan menggunakan posisi frame landscape, agar peserta lebih leluasa untuk bergaya dan berekspresi</span></span></span></span></span></span></p>',-1,3,2,'2022-01-14 22:43:18','2022-01-14 15:43:18','2022-01-14 15:49:05'),(81,2,'Apa yang dimaksud One Take Shot?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Konsep pengambilan gambar/video dalam satu kali pengambilan saja</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:44:21','2022-01-14 15:44:21','2022-01-14 15:44:21'),(82,2,'Apa diperbolehkan merekam menggunakan handphone?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Peserta diperbolehkan merekam menggunakan handphone, tetapi harus jelas</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:45:14','2022-01-14 15:45:14','2022-01-14 15:45:14'),(83,2,'Apakah peserta diperbolehkan memakai microphone yang langsung terkoneksi ke Handphone dan Kamera?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Boleh, namun tidak diperbolehkan mixing ataupun editing video</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:45:59','2022-01-14 15:45:59','2022-01-14 15:45:59'),(84,2,'Apa perserta diperbolehkan nyanyi sambil memainkan alat musik?','<p><br />\r\n<span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Boleh saja, yang terpenting suara vocal terdengar dengan jelas dan sesuai dengan lagu yang dipilih. Point yang dinilai yakni vocal bukan instrumen</span></span></span></span></span></span></p>',1,3,2,'2022-01-14 22:46:44','202