'i-SMP/Mts sudah melewati batas waktu pembayaran',1,'2022-01-12 12:03:30','2022-01-12 12:03:30'),(113,5,2,0,2,'Jawaban Baru','<b>BAGAIMANA JIKA PENGAMBILAN VIDEO TIDAK ONE TAKE SHOT CARA PENGAMBILAN VIDEONYA?</b><p><span style=\"color:#000000;\">TIDAK DIPERBOLEHKAN KARENA ITU SUDAH MENJADI PERATURAN UNTUK MENGHINDARI ADANYA KECURANGAN SEPERTI MENGEDIT VIDEO, CUT DLL.</span></p>',0,'2022-01-12 12:07:54','2022-01-12 12:07:54'),(114,5,2,0,2,'Jawaban Baru','<b>BAGAIMANA JIKA MELEBIHI WAKTU YANG SUDAH DITENTUKAN?</b><p>Apabila melebihi waktu yang sudah ditentukan, maka ada pengurangan nilai. Tetapi, kami memberikan toleransi 1 menit lebih dari itu mendapatkan pengurangan nilai.</p>',0,'2022-01-12 12:22:52','2022-01-12 12:22:52'),(115,5,2,0,2,'Jawaban Baru','<b>SEANDAINYA MENGGUNAKAN LEBIH DARI 3 NADA APAKAH BISA?</b><p>TIDAK MASALAH, YANG PENTING SEMPURNA (TAJWID DAN FASHAHAH) DALAM PEMBACAANNYA.<br />\r\nTidak masalah, yang penting sempurna (Tajwid dan Fashahah) dalam pembacaannya.</p>',0,'2022-01-12 12:23:17','2022-01-12 12:23:17'),(116,5,2,0,2,'Jawaban Baru','<b>Bagaimana jika video yang dikirimkan kurang berkualitas?</b><p>Tidak masalah, yang penting peserta masih bisa terlihat dalam video tersebut. Tetapi disarankan kualitas video 720p/HD.</p>\r\n\r\n<p style=\"line-height:1.3800000000000001; margin-left:48px\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',0,'2022-01-12 12:23:29','2022-01-12 12:23:29'),(117,5,2,0,2,'Jawaban Baru','<b>BAGAIMANA TEKNIK PENJURIANNYA?</b><p>TEKNIK PENJURIAN AKAN MEMAKAI JURI DARI KEMENAG DAN KAMI AKAN MEMANTU PENJURIANNYA. PENJURIAN TERSEBUT AKAN TRANSPARAN DAN AKAN DITAMPILKAN CUPLIKAN PROSES PENJURIAN.|<br />\r\nTeknik penjurian akan memakai juri dari kemenag dan kami akan memantau penjuriannya. Penjurian tersebut akan transparan dan akan ditampilkan cuplikan proses penjurian.</p>',0,'2022-01-12 12:23:55','2022-01-12 12:23:55'),(118,5,2,0,2,'Jawaban Baru','<b>SEANDAINYA MENGGUNAKAN LEBIH DARI 3 NADA APAKAH BISA?</b><p>Tidak masalah, yang penting sempurna (Tajwid dan Fashahah) dalam pembacaannya.</p>',0,'2022-01-12 12:24:27','2022-01-12 12:24:27'),(119,5,2,0,2,'Jawaban Baru','<b>BAGAIMANA JIKA MELEBIHI WAKTU YANG SUDAH DITENTUKAN? Bagaimana jika melebihi waktu yang sudah ditentukan</b><p>Apabila melebihi waktu yang sudah ditentukan, maka ada pengurangan nilai. Tetapi, kami memberikan toleransi 1 menit lebih dari itu mendapatkan pengurangan nilai.</p>',0,'2022-01-12 12:24:36','2022-01-12 12:24:36'),(120,5,2,0,2,'Jawaban Baru','<b>Bagaimana jika melebihi waktu yang sudah ditentukan?</b><p>Apabila melebihi waktu yang sudah ditentukan, maka ada pengurangan nilai. Tetapi, kami memberikan toleransi 1 menit lebih dari itu mendapatkan pengurangan nilai.</p>',0,'2022-01-12 12:24:51','2022-01-12 12:24:51'),(121,5,2,0,2,'Jawaban Baru','<b>Seandainya menggunakan lebih dari 3 nada apakah bisa?</b><p>Tidak masalah, yang penting sempurna (Tajwid dan Fashahah) dalam pembacaannya.</p>',0,'2022-01-12 12:25:38','2022-01-12 12:25:38'),(122,5,2,0,2,'Jawaban Baru','<b>BAGAIMANA TEKNIK PENJURIANNYA?</b><p>Teknik penjurian akan memakai juri dari kemenag dan kami akan memantau penjuriannya. Penjurian tersebut akan transparan dan akan ditampilkan cuplikan proses penjurian.</p>',0,'2022-01-12 12:26:06','2022-01-12 12:26:06'),(123,5,2,0,2,'Jawaban Baru','<b>Bagaimana teknik penjuriannya?</b><p>Teknik penjurian akan memakai juri dari kemenag dan kami akan memantau penjuriannya. Penjurian tersebut akan transparan dan akan ditampilkan cuplikan proses penjurian.</p>',0,'2022-01-12 12:26:10','2022-01-12 12:26:10'),(124,5,2,0,2,'Jawaban Baru','<b>Apakah ada aturan untuk mewarnai designnya?</b><p><span style=\"font-size:13.999999999999998pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Tidak ada, untuk warna bisa disesuaikan dengan karya yang dibuat oleh masing - mas